import logo from './logo.svg';
import './App.css';

function App() {
  new fullpage('#fullpage', {
    //options here
    autoScrolling:true,
    scrollHorizontally: true
  });

  //methods
  fullpage_api.setAllowScrolling(false);

  return (
    <div className="App">
        <div id="fullpage">
          <div class="section">Some section</div>
          <div class="section">Some section</div>
          <div class="section">Some section</div>
          <div class="section">Some section</div>
        </div>
    </div>
  );

}

export default App;
